css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.ons-team.com") {

body {
background: #111 url('data:image/jpeg;base64,') !important; border: none !important;
background-repeat: repeat !important;
color: #bbbbbb !important;
}

a, strong {
color: #86B0E1 !important;
border: none !important;
}


input, textarea {
background: #1e1e1e !important;
color: #fff !important;
}


a:hover {
color:white !important;
}

::-moz-selection {
background: #86B0E1 !important; 
color: #fff !important; 
}


div, .entry-title, .page-title
{
background: #111 url('data:image/jpeg;base64,') !important; border: none !important;
background-repeat: repeat !important;
color: #eeeeee !important;

}

}
